import React from 'react';
import venusmenu from './Venus_menu.module.scss'
import venusani from './Venus_animation.module.scss';

const Mercury = ({checked}) => {
    return (
        <>
            <div id= {checked ? meryani.mercury_animode : mercurymenu.mercury_menumode}></div>
        </>
    );
};

export default Mercury;
